import "./login.css";
import HeaderOne from '../header/header.js'
import axios, {post} from 'axios'

export default function Login(){
 const [email, setEmail] = useState('');
    const [password, setPassword] = useState('');
    const enviaDados = async (e) => {
        console.log('enviando');
        e.preventDefault(); 
        
        axios //faz chamada http
        .post('http://localhost:3001/login', 
        {
          email, password// nome: nome
        })
          .then((response) => {
            
          
          })
          .catch((error) => {
            console.log('erro enviando formulario')
            console.log(error);
          });
        }


    return(
    <div>
        <HeaderOne pagLogin={true} login={false}></HeaderOne>
        
        

        <div id="inputs">
        <h1>Login</h1>
        <input
            type="email"
            className="email"
            name="email"
            onChange={(v) => setEmail(v.target.value)}
            value={email} placeholder="Email"/>
          <br />
          <br />
        <input
            type="password"
            className="password"
            name="password"
            onChange={(v) => setPassword(v.target.value)}
            value={password} placeholder="Senha"/>
          <br />
          <br />
          <button onClick={enviaDados} value="Enviar" className="forms-button">
          Enviar{" "}
        </button>

        </div>
        </div>
    )
}
